export const WeatherObjectCon = (location, temperature, cloudy, wind, Humidity, pressure) => {
    console.log(location);
    console.log(temperature)
    console.log(cloudy)
    console.log(wind);
    console.log(Humidity)
    console.log(pressure)
    return {
        'Location': location,
        'Temperature': temperature,
        'Cloudy': cloudy,
        'Wind': wind,
        'Humaidity': Humidity,
        'Pressure': pressure
    }
}
